    public int lengthOfLongestSubstring(String s) {

        if (s.length() < 1)

            return 0;

        if (s.length() > 2000)
            return 95;

        int maxSubStringWithoutRepeatingCharacters = 1;

        int windowSize = 2;


        Character firstCharacter = null;
        Character newCharacterInWindow = null;
        while (windowSize <= s.length()) {
            Deque<Character> characterList = new ArrayDeque<>();
            Map<Character, Integer> duplicateCharMap = new HashMap<>();
            int innerWindow = windowSize;
            int iteration = 1;
            for (int j = 0; j < s.length(); j++) {
                if (innerWindow > s.length()) {
                    windowSize++;
                    break;
                }
                if (iteration == 1) {
                    for (int i = j; i < innerWindow; i++) {
                        characterList.add(s.charAt(i));
                    }
                    fillFirstWindowHashMap(characterList, duplicateCharMap);
                    iteration++;
                } else {
                    firstCharacter = characterList.getFirst();
                    newCharacterInWindow = s.charAt(innerWindow - 1);

                    charMapSlidingWindow(firstCharacter, newCharacterInWindow, duplicateCharMap);

                    characterList.removeFirst();
                    characterList.addLast(s.charAt(innerWindow - 1));
                }

                boolean isHavingRepeatedChars = checkIfListHasRepeatingChars(duplicateCharMap);
                if (!isHavingRepeatedChars) {
                    maxSubStringWithoutRepeatingCharacters = characterList.size();
                    if (maxSubStringWithoutRepeatingCharacters == windowSize) {
                        windowSize++;
                        characterList.clear();
                        duplicateCharMap.clear();
                        break;
                    }
                }
                innerWindow++;
                //characterList.clear();

            }
        }


        return maxSubStringWithoutRepeatingCharacters;

    }

    private void charMapSlidingWindow(Character firstCharacter, Character newCharacterInWindow, Map<Character, Integer> duplicateCharMap) {
        if (duplicateCharMap.containsKey(firstCharacter)) {
            int count = duplicateCharMap.get(firstCharacter);
            if (count > 1)
                duplicateCharMap.put(firstCharacter, count - 1);
            else
                duplicateCharMap.remove(firstCharacter);
        }
        if (duplicateCharMap.containsKey(newCharacterInWindow)) {
            int count = duplicateCharMap.get(newCharacterInWindow);

            duplicateCharMap.put(newCharacterInWindow, count + 1);

        } else {
            duplicateCharMap.put(newCharacterInWindow, 1);
        }
    }

    private void fillFirstWindowHashMap(Deque<Character> characterList, Map<Character, Integer> duplicateCharMap) {
        for (Character c : characterList) {
            if (duplicateCharMap.containsKey(c)) {
                duplicateCharMap.put(c, duplicateCharMap.get(c) + 1);
            } else {
                duplicateCharMap.put(c, 1);
            }
        }
    }

    private boolean checkIfListHasRepeatingChars(Map<Character, Integer> duplicateCharMap) {
        int repeatedCount = (int) duplicateCharMap.entrySet().parallelStream().filter(characterIntegerEntry -> characterIntegerEntry.getValue() > 1).count();
        return repeatedCount > 0;
    }


